import dayjs, { Dayjs } from 'dayjs';
import { Checkbox, DatePicker, Space, DatePickerProps, GetRef } from 'antd';

type PickerRef = GetRef<typeof DatePicker>;

export type ExpireDatePickerProps = Omit<DatePickerProps, 'format' | 'value'> & {
  format?: string;
  value?: Dayjs | string;
  longTermValue?: string;
  longTermLabel?: string;
  hideOnLongTerm?: boolean;
};

const ExpireDatePicker: React.FC<ExpireDatePickerProps> = ({
  longTermValue = '9999-12-31',
  longTermLabel = '\u957F\u671F',
  hideOnLongTerm = true,
  format = 'YYYY-MM-DD',
  value,
  onChange,
  disabled,
  ...restProps
}) => {
  const datePickerRef = useRef<PickerRef>(null);
  const valueIsDayjs = dayjs.isDayjs(value);
  const fmtValue = valueIsDayjs ? value.format(format) : value;
  const valueIsLongTerm = fmtValue === longTermValue;

  return (
    <Space>
      {(!hideOnLongTerm || !valueIsLongTerm) && (
        <DatePicker
          value={value && !valueIsDayjs ? dayjs(value) : (value as Dayjs | undefined)}
          disabled={valueIsLongTerm || disabled}
          onChange={onChange}
          ref={datePickerRef}
          {...restProps}
        />
      )}
      <Checkbox
        style={{ marginTop: 5, marginBottom: 5, whiteSpace: 'nowrap' }}
        checked={valueIsLongTerm}
        onChange={() => {
          if (!valueIsLongTerm) {
            onChange?.(dayjs(longTermValue), longTermValue);
          } else {
            // @ts-ignore
            onChange?.(null, '');
            setTimeout(() => {
              datePickerRef.current?.focus();
            });
          }
        }}
        disabled={disabled}
      >
        {longTermLabel}
      </Checkbox>
    </Space>
  );
};

export default ExpireDatePicker;
