import { createPuzzle } from 'create-puzzle';
import DemoImage from './sunflower.jpg';

// \u8BB0\u5F55 id \u5BF9\u5E94 x \u504F\u79FB\u503C\uFF0C\u7528\u6765\u9A8C\u8BC1
// \u5982\u679C\u8981\u6DFB\u52A0\u7F13\u5B58\u6570\u636E\u751F\u547D\u5468\u671F\uFF0C\u63A8\u8350\u4F7F\u7528 cache2: https://www.npmjs.com/package/cache2
const cache: Record<string, number> = {};

export type CaptchaDataType = {
  id: string;
  bgUrl: string;
  puzzleUrl: string;
};

export const getCaptcha = async () => {
  await sleep(500);
  const res = await createPuzzle(DemoImage, {
    format: 'blob'
  });
  const id = uniqueId('captchaId_');
  cache[id] = res.x;

  return {
    id,
    bgUrl: res.bgUrl,
    puzzleUrl: res.puzzleUrl
  };
};

export const verifyCaptcha = async (data: { id: string; x: number }) => {
  await sleep();
  let result = false;
  if (data && cache[data.id]) {
    // value is offset \xB15
    result = inRange(data.x, cache[data.id] - 5, cache[data.id] + 5);
    delete cache[data.id];
  }
  return result ? Promise.resolve() : Promise.reject();
};
